import React from 'react'

function AddEntityModal() {

    return (
        <form style={{ padding: "50px" }}>
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Entity</label><br /><br />
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none",
                width: "100%"
            }} type="text" /><br /><br /><br />
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Normolized Value</label><br /><br />
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none",
                width: "100%"
            }} type="text" /><br /><br /><br />
            <label style={{
                fontFamily: "poppins",
                marginBottom: "10px",
                fontSize: "14px"
            }}>Synonym</label><br /><br />
            <input style={{
                padding: "8px",
                border: "2px solid lightgray",
                borderRadius: "5px",
                outline: "none",
                width: "100%"
            }} type="text" /><br /><br /><br />
            <button type="submit">Submit</button>
        </form>
    )
}

export default AddEntityModal
